INSERT INTO settings (id, key, value, category, label, type, updated_at, description) VALUES (21, 'about_description', 'Jaberco® is a leading provider of Amazon return pallets in Canada. We specialize in offering high-quality pallets at competitive prices, with a focus on customer satisfaction and transparent business practices.', 'about', 'About Description (Short)', 'textarea', '2025-05-09T00:24:19.036Z', 'Short description about the company');
INSERT INTO settings (id, key, value, category, label, type, updated_at, description) VALUES (22, 'about_mission', 'Our mission is to provide access to quality Amazon return pallets at affordable prices while maintaining the highest standards of customer service and satisfaction.', 'about', 'Our Mission', 'textarea', '2025-04-21T23:32:50.924Z', 'Company mission statement');
INSERT INTO settings (id, key, value, category, label, type, updated_at, description) VALUES (23, 'about_vision', 'We aim to be the most trusted source for Amazon return pallets in Canada, known for our integrity, quality products, and exceptional customer experience.', 'about', 'Our Vision', 'textarea', '2025-04-21T23:32:50.924Z', 'Company vision statement');
INSERT INTO settings (id, key, value, category, label, type, updated_at, description) VALUES (24, 'about_history', 'Founded in 2022, Jaberco started with a simple goal: to make Amazon return pallets accessible to resellers and businesses of all sizes. What began as a small operation has grown into a trusted source for quality products across Canada.', 'about', 'Our History', 'textarea', '2025-04-22T00:52:04.838Z', 'Brief company history');
