INSERT INTO faqs (id, question, answer, display_order, created_at, updated_at) VALUES (1, 'What is an Amazon Returns Pallet?', 'An Amazon Returns Pallet is a collection of products that have been returned to Amazon by customers. These items are typically resold at a significant discount from their original price.', 1, '2025-04-22T02:30:26.033Z', '2025-04-22T02:30:26.033Z');
INSERT INTO faqs (id, question, answer, display_order, created_at, updated_at) VALUES (2, 'How does the buying process work?', 'Visit Our Location
INSERT INTO faqs (id, question, answer, display_order, created_at, updated_at) VALUES (3, 'What condition are the items in?', 'The items can vary widely in condition, ranging from brand new and unused to gently used or previously owned. Some products may have minor cosmetic flaws or functional issues that can be easily repaired, while others are in excellent, like-new condition and ready for immediate use or resale.', 3, '2025-04-22T02:30:26.033Z', '2025-04-23T01:15:19.232Z');
INSERT INTO faqs (id, question, answer, display_order, created_at, updated_at) VALUES (4, 'Do you offer shipping?', 'Yes, we offer shipping throughout Canada. Shipping costs depend on the destination and the size of the pallet.', 4, '2025-04-22T02:30:26.033Z', '2025-04-22T02:30:26.033Z');
INSERT INTO faqs (id, question, answer, display_order, created_at, updated_at) VALUES (5, 'Can I inspect the pallet before buying?', 'Yes, you can schedule an appointment to come inspect the pallets in person before making a purchase. Contact us to arrange a viewing.', 5, '2025-04-22T02:30:26.033Z', '2025-04-22T02:30:26.033Z');
